import { GridColumn } from 'semantic-ui-react';




function App() {
  return (
    <React.Fragment>
      <Contacts/>
      <GridColumn width="2">
        <Menu/>
        {/* <Home/>  */}
      </GridColumn>

    </React.Fragment>


  );
}

export default App;
